import {BrowserRouter as Router, Route, Switch} from "react-router-dom"
import './App.css';

function App() {
  return (
    <div className="App">
    <Router>
      <Switch>
        <Route path="/room">Chat Page</Route>
        <Route path="/">Login Page</Route>
      </Switch>
    </Router>
    </div>
  );
}

export default App;
